/*
 * https://leetcode-cn.com/problems/subarray-product-less-than-k/
 */
#include <iostream>
#include <unordered_map>
#include <unordered_set>
#include <vector>

using namespace std;
class Solution {
public:
    int numSubarrayProductLessThanK(vector<int>& nums, int k) {
        int32_t ans = 0;
        int32_t res = 1;
        
        for(int i = 0; i < nums.size(); ++i){
            res = 1; 
            for(int j = i; j < nums.size(); ++j){
                res *= nums[j];
                if(res >= k){
                    break;
                }
                ++ans;
            }
        }
        return ans;
    }
};

namespace Optimize{
class Solution {
public:
    int numSubarrayProductLessThanK(vector<int>& nums, int k) {
        if(k <= 1){
            return 0;
        }
        int32_t ans = 0;
        int32_t res = 1;
        int32_t left = 0, right = 0;
        for(int32_t left = 0, right = 0; right < nums.size(); ++right){
            res *= nums[right];
            while(res >= k){
                res /= nums[left];
                ++left;
            }
            ans += right - left + 1;
        }
        return ans;
    }
};
}


